// eslint-disable-next-line no-undef
(function () {
  "use strict";

  let div = document.createElement("DIV");

  div.innerHTML = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="1920" height="1244">

  <g transform="matrix(1.3333334 0 0 1.3333334 0 0)">
      <image x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="1440" height="933"/>
  </g>
  </svg>`;

  div.classList.add("img_cover");
  document.body.appendChild(div);
  GM_addStyle(
    ".img_cover{width:100vw; height:101vh;width: 98vw;height: 117vh;position: fixed;left: 0;top: -4%;z-index: 99999999999;}"
  );
})();
